import React from 'react';
import styled from 'styled-components';


 export const InputArea = styled.View`
width:85%;
background-color:rgb(212,220,239)››;
padding: 14px;
margin-bottom: 30px;
align-self: center;
border-radius: 20px;

`;

export const H1 = styled.Text`
 font-size: 26px;
 font-weight: bold;
 margin-bottom:60px;
 align-self: center;
 color:rgb(125,33,132);

`

export  const HeaderName=styled.Image`
      width: 122px;
      height: 35px;

      align-self: center;

 `



 export const  Container= styled.View`
flex:1;
 position: relative;
 align-items: center;
 justify-content: center;
 background-color:rgb(212,220,239) ;

 `


  export const Button =styled.TouchableOpacity`
 margin-top: 30px;
 padding:10px;
 width: 100%;
 justify-content: center;
 align-items: center;



  `

 export  const ButoonImage= styled.Image`
 width:50px;
 height: 50px;
 `



export const LoginTextButton = styled.Text`
color:#fff;
text-align: center;
font-size: 20px;
font-weight: bold;

`

  export const InputBox= styled.View`
  margin-top: 10px;
  height: 50px;
  display: flex;
  flex-direction: row;
  background-color: #fff;
  justify-content: center;
  align-items: center;
  padding: 10px;
  border-radius: 10px;



  `
  export const Input  = styled.TextInput`
       width: 90%;
       height: 50px;
       background-color: #fff;
       border-radius:4px ;
       padding: 10px;
       margin-left: 5px;


  `
  export const Label = styled.Text`
  font-size:18px;
  margin-bottom: 6px;


  `
   export const Img = styled.Image`
      width: 80px;
      height: 80px;
      margin-top: 30px;
      align-self: center;

   `
